import React from 'react';

import './collectionCards.css';
import Card from '../../items/card/card';

const CollectionCards = (props) => {
  return (
    <section className="collectionCards">
      {props.data.map((element))}
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
    </section>
  );
};

export default CollectionCards;
